import React from 'react'
// import 'Ourwork.css'
import "../ourwork/Ourwork.css"
import Ourworkmenu from './Ourworkmenu'
function Ourwork() {
  return (
    <div class="container">
    <h1>Our Work</h1>
    <div className="menu-tab d-flex justify-content-around">
      <button className="btn btn-warning"></button>
    </div>
  </div>
  )
}

export default Ourwork
